import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class Wrapper extends Component {
  render() {
    return (
      <div className="portfolio-wrapper">
        <PorfolioItem />
        <PorfolioItem />
        <PorfolioItem />
        <PorfolioItem />
        <PorfolioItem />
        <PorfolioItem />
        <PorfolioItem />
        <PorfolioItem />
        <PorfolioItem />
      </div>
    );
  }
}

class PorfolioItem extends Component {
  render() {
    return <div />;
  }
}

export default Wrapper;
